from collections import Counter


class Solution:
    def wordSubsets(self, A, B):
        """
        :type A: List[str]
        :type B: List[str]
        :rtype: List[str]
        """
        dct_B = Counter()
        for b in B:
            for k, v in Counter(b).items():
                dct_B[k] = max(dct_B[k], v)
        print(dct_B)

        res = []
        for a in A:
            bol = False
            dct_a = Counter(a)

            for kv in dct_B:
                if dct_B[kv] <= dct_a[kv]:
                    bol = True
                else:
                    bol = False
                    break
            if bol:
                res.append(a)
        return res



obj = Solution()
print(obj.wordSubsets(["amazon", "apple", "facebook", "google", "leetcode"], ["ec", "oc", "ceo"]))
